import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";
import React, { createContext, useEffect, useState, lazy, Suspense } from "react";
import { Routes, Route, Link, useNavigate, Outlet } from "react-router-dom";
import axios from "axios";
import { useQuery } from 'react-query';

import data from "./data";

// lazy -> 사이트 발행할 때 별도의 js로 분리됨
const Detail = lazy(() => import('./routes/Detail'));
const Cart = lazy(() => import('./routes/Cart'))


export let Context1 = createContext() // state 보관함


function App() {

  useEffect(() => {
    localStorage.setItem('watched', JSON.stringify([]))
    // get 얻어지면? :
    // localStorage.getItem('watched')? null : localStorage.setItem('watched', JSON.stringify([]))
  }, [])

  let [shoes, setShoes] = useState(data);
  let [재고, 재고변경] = useState([10,11,12]);
  let navigate = useNavigate();

  let result = useQuery('작명', () => {
    return axios.get('https://codingapple1.github.io/userdata.json')
    .then((a)=>{ return a.data }),
    {staleTime: 2000} // 2초 안에는 refetch xx -> 타이머 기능
  })
c
  return (
    <div className="App">

      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home">shop</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link
              onClick={() => {
                navigate("/");
              }}
            >
              Home
            </Nav.Link>
            <Nav.Link
              onClick={() => {
                navigate("/detail");
              }}
            >
              Detail
            </Nav.Link>
            {/* <Link to="/">홈</Link>
            <Link to="/detail">상세페이지</Link> */}
          </Nav>
          <Nav>
            {/* { result.isLoading ? '로딩중' : result.data.name } */}
            { result.isLoading && '로딩중'}
            { result.error && '에러남'}
            { result.data && result.data.name }
            </Nav>
        </Container>
      </Navbar>

      <Suspense fallback={<div>로딩중임</div>}>
        <Routes>
          <Route path="/"element={
              <>
                <div className="main-bg"></div>
                <Container>
                  <Row>
                    {shoes.map((a, i) => {
                      return <Card shoes={shoes[i]} i={i} />;
                    })}
                  </Row>
                </Container>

                <button onClick={() => {
                  // 로딩중 ui 띄우기
                  axios.get('https://codingapple1.github.io/shop/data2.json')
                  .then((result) => {
                    // console.log(result.data);
                    let copy = [...shoes, ...result.data];
                    setShoes(copy);
                    // 로딩중 ui 숨기기
                  })
                  .catch(() => {
                    // 로딩중 ui 숨기기
                    console.log('실패함 ㅅㄱ')
                  })
                }}>버튼</button>
              </>
            }
          />

            <Route path="/detail/:id" element={
                <Context1.Provider value={{재고, shoes}}>
                  <Detail shoes={shoes} />
                </Context1.Provider>

            } />

          <Route path="/about" element={<About />}>
            <Route path="member" element={<div>멤버임</div>} />
            <Route path="location" element={<div>위치임</div>} />
          </Route>
          <Route path="/event" element={<Event />}>
            <Route path="one" element={<div>첫 주문시 양배추즙 서비스</div>} />
            <Route path="two" element={<div>생일기념 쿠폰받기</div>} />
          </Route>
          <Route path='/cart' element={ <Cart /> }/>
          <Route path="*" element={<div>없는 페이지요</div>} />
        </Routes>
       </Suspense>
    </div>
  );

  // 컴포넌트
  function Card(props) {
    return (
      <Col>
        <img src={"https://codingapple1.github.io/shop/shoes" + (props.i + 1) + ".jpg"} width="80%" />
        <h4>{props.shoes.title}</h4>
        <p>{props.shoes.price}</p>
      </Col>
    );
  }

  function About() {
    return (
      <div>
        <h4>회사 정보임</h4>
        <Outlet></Outlet>
      </div>
    );
  }

  function Event() {
    return (
      <div>
        <h4>오늘의 이벤트</h4>
        <Outlet></Outlet>
      </div>
    );
  }
}

export default App;
